import React from "react";
import {useNavigate} from "react-router-dom";



function Test(props){
    function submithandler(){
        const navigate = useNavigate()
        navigate("/login");
    }

    return (<button onSubmit={submithandler} >Hallo</button>)
}

export default Test;
